import React from "react";

import { BrowserRouter as Router, Route, Switch } from "react-router-dom";

import AdminHome from "./AdminHome";
// import fRegistration from "./Registration";
import AdminNavbar from "./AdminNavbar";
import addDonors from "./addDonors";
import showDonors from "./ShowDonors";
// import Prof from "./Prof";
// import ProfileEdit from "./ProfileEdit";
// import orders from "./orders";
import axios from "axios";

export default class AllF extends React.Component {
  state = {
    users: [],
    products: [],
    category: [],
  };

  getCategory = async () => {
    const config = {
      headers: {
        "Content-Type": "application/json",
      },
    };
    try {
      const res = await axios.get(
        "http://localhost:5000/api/v1/category/",
        config
      );
      this.setState({
        category: res.data.data,
      });
      console.log(this.state.category);
    } catch (err) {
      console.log("Can't load the items");
    }
  };
  render() {
    return (
      <Router>
        <div className="">
          <AdminNavbar />

          <Switch>
            <Route exact path={"/citizen/Home"} component={AdminHome} />
            {/* <Route
              exact
              path={"/citizen/addDonors"}
              render={(props) => (
                <addDonors
                  {...props}
                  getCategory={this.getCategory}
                  category={this.state.category}
                />
              )}
            /> */}
            <Route
              path={"/citizen/addDonors"}
              component={addDonors}
              getCategory={this.getCategory}
              category={this.state.category}
            />
            <Route path={"/citizen/showDonors"} component={showDonors} />
          </Switch>
        </div>
      </Router>
    );
  }
}
